import React from 'react';
import uniqid from "uniqid";

const EducationInfo = (props) => {
  const { titles } = props;
  return (
    <div>
       {props.titles.map((title) => {
        return <div key={uniqid()}> <a>{title.from}-{title.to} {title.titleName}, {title.school} {"\n"}
        {title.moreInfo} </a> <span>x</span>
        </div>;
      })}
    </div>
  );
};

export default EducationInfo;
